if mibBuilder.loadTexts: docsIetfQosParamSetType.setReference('SP-RFIv2.0-I06-040804, 8.1.5')
if mibBuilder.loadTexts: docsIetfQosParamSetType.setStatus('current')
if mibBuilder.loadTexts: docsIetfQosParamSetType.setDescription('Defines the type of the QOS parameter set defined by this row. active(1) indicates the Active QOS parameter set, describing the service currently being provided by the DOCSIS MAC domain to the Service Flow. admitted(2) indicates the Admitted QOS Parameter Set, describing services reserved by the DOCSIS MAC domain for use by the service flow. provisioned (3) describes the QOS Parameter Set defined in the DOCSIS CM Configuration file for the Service Flow.')
docsIetfQosParamSetRequestPolicyOct = MibTableColumn((1, 3, 6, 1, 2, 1, 127, 1, 2, 1, 21), OctetString().subtype(subtypeSpec=ValueSizeConstraint(4, 4)).setFixedLength(4)).setMaxAccess("readonly")
if mibBuilder.loadTexts: docsIetfQosParamSetRequestPolicyOct.setReference('SP-RFIv2.0-I06-040804, Appendix C.2.2.6.3')
